import React from "react";

function Card(props){



    return (
        <div className="card ">
            <img src={props.cardData.image} alt="User Image"/>
            <h1>{props.cardData.name}</h1>
            <h2>{props.cardData.function}</h2>
            if ({props.cardData.phone} == "") {
                <h3>`Phone: ${props.phone}`</h3>
            }
            if ({props.cardData.email} == "") {
                <h3>`Email: ${props.email}`</h3>
            }
            if ({props.cardData.website} == ""}) {
                <h3>`Website: ${props.website}`</h3>
            }
            
        </div>
    );

}

export default Card;
